import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import FileUpload from './FileUpload';
import './AdmissionForm.css';

const AdmissionForm = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);
  const [formData, setFormData] = useState({
    // Personal Information
    first_name: '',
    middle_name: '',
    last_name: '',
    email: '',
    birth_date: '',
    gender: '',
    civil_status: '',
    nationality: '',
    religion: '',
    address: '',
    phone: '',
    
    // Family Background
    father_name: '',
    father_occupation: '',
    mother_name: '',
    mother_occupation: '',
    guardian_name: '',
    guardian_contact: '',
    
    // Educational Background
    elementary_school: '',
    elementary_year: '',
    junior_high: '',
    junior_high_year: '',
    senior_high: '',
    senior_high_year: '',
    last_school_attended: '',
    
    // Course Preference
    course_choice_1: '',
    course_choice_2: '',
    course_choice_3: '',
    
    // Documents
    birth_certificate: '',
    form_137: '',
    form_138: '',
    good_moral: '',
    id_photos: ''
  });

  const [formErrors, setFormErrors] = useState({});

  const courses = [
    'Bachelor of Science in Computer Science',
    'Bachelor of Science in Information Technology',
    'Bachelor of Science in Computer Engineering',
    'Bachelor of Science in Electrical Engineering',
    'Bachelor of Science in Mechanical Engineering',
    'Bachelor of Science in Civil Engineering',
    'Bachelor of Science in Business Administration',
    'Bachelor of Science in Accountancy',
    'Bachelor of Science in Hospitality Management',
    'Bachelor of Elementary Education',
    'Bachelor of Secondary Education',
    'Bachelor of Science in Nursing',
    'Bachelor of Science in Psychology'
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));

    if (formErrors[name]) {
      setFormErrors(prev => ({
        ...prev,
        [name]: ''
      }));
    }
  };

  const handleFileUpload = (fileType, fileUrl) => {
    setFormData(prev => ({
      ...prev,
      [fileType]: fileUrl
    }));
  };

  const validateForm = () => {
    const errors = {};
    const required = [
      'first_name', 'last_name', 'email', 'birth_date', 'gender', 
      'address', 'phone', 'father_name', 'mother_name',
      'elementary_school', 'junior_high', 'senior_high',
      'course_choice_1'
    ];

    required.forEach(field => {
      if (!formData[field].trim()) {
        errors[field] = 'This field is required';
      }
    });

    if (!formData.email.includes('@')) {
      errors.email = 'Valid email is required';
    }

    setFormErrors(errors);
    return Object.keys(errors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    if (!validateForm()) {
      alert('Please fill in all required fields');
      setLoading(false);
      return;
    }

    try {
      const { data, error } = await supabase
        .from('student_admissions')
        .insert([{
          ...formData,
          submitted_at: new Date().toISOString(),
          application_id: 'APP' + Date.now()
        }])
        .select();

      if (error) throw error;

      alert('Application submitted successfully! Your application ID: ' + data[0].application_id);
      navigate('/applications');

    } catch (error) {
      alert('Error submitting application: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="fillup-form-page">
      <div className="form-paper">
        {/* Form Header */}
        <div className="form-header">
          <div className="university-header">
            <h1>UNIVERSITY OF TECHNOLOGY</h1>
            <p>Office of the University Registrar</p>
            <h2>STUDENT APPLICATION FORM</h2>
          </div>
          <div className="form-instructions">
            <p><strong>Instructions:</strong> Fill out all fields completely and accurately. Use CAPITAL LETTERS.</p>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          {/* Section 1: Personal Information */}
          <div className="form-section">
            <div className="section-header">
              <span className="section-number">I.</span>
              <h3>PERSONAL INFORMATION</h3>
            </div>
            
            <div className="form-grid">
              <div className="input-group">
                <label>First Name <span className="required">*</span></label>
                <input
                  type="text"
                  name="first_name"
                  value={formData.first_name}
                  onChange={handleInputChange}
                  className={formErrors.first_name ? 'error' : ''}
                  placeholder="Enter first name"
                />
              </div>

              <div className="input-group">
                <label>Middle Name</label>
                <input
                  type="text"
                  name="middle_name"
                  value={formData.middle_name}
                  onChange={handleInputChange}
                  placeholder="Enter middle name"
                />
              </div>

              <div className="input-group">
                <label>Last Name <span className="required">*</span></label>
                <input
                  type="text"
                  name="last_name"
                  value={formData.last_name}
                  onChange={handleInputChange}
                  className={formErrors.last_name ? 'error' : ''}
                  placeholder="Enter last name"
                />
              </div>

              <div className="input-group">
                <label>Email Address <span className="required">*</span></label>
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleInputChange}
                  className={formErrors.email ? 'error' : ''}
                  placeholder="your.email@example.com"
                />
              </div>

              <div className="input-group">
                <label>Birth Date <span className="required">*</span></label>
                <input
                  type="date"
                  name="birth_date"
                  value={formData.birth_date}
                  onChange={handleInputChange}
                  className={formErrors.birth_date ? 'error' : ''}
                />
              </div>

              <div className="input-group">
                <label>Gender <span className="required">*</span></label>
                <select
                  name="gender"
                  value={formData.gender}
                  onChange={handleInputChange}
                  className={formErrors.gender ? 'error' : ''}
                >
                  <option value="">Select Gender</option>
                  <option value="Male">Male</option>
                  <option value="Female">Female</option>
                </select>
              </div>

              <div className="input-group">
                <label>Civil Status</label>
                <select
                  name="civil_status"
                  value={formData.civil_status}
                  onChange={handleInputChange}
                >
                  <option value="">Select Status</option>
                  <option value="Single">Single</option>
                  <option value="Married">Married</option>
                  <option value="Widowed">Widowed</option>
                </select>
              </div>

              <div className="input-group">
                <label>Nationality</label>
                <input
                  type="text"
                  name="nationality"
                  value={formData.nationality}
                  onChange={handleInputChange}
                  placeholder="Filipino"
                />
              </div>

              <div className="input-group">
                <label>Religion</label>
                <input
                  type="text"
                  name="religion"
                  value={formData.religion}
                  onChange={handleInputChange}
                  placeholder="Catholic"
                />
              </div>

              <div className="input-group full-width">
                <label>Complete Address <span className="required">*</span></label>
                <input
                  type="text"
                  name="address"
                  value={formData.address}
                  onChange={handleInputChange}
                  className={formErrors.address ? 'error' : ''}
                  placeholder="House No., Street, Barangay, City/Municipality, Province"
                />
              </div>

              <div className="input-group">
                <label>Contact Number <span className="required">*</span></label>
                <input
                  type="tel"
                  name="phone"
                  value={formData.phone}
                  onChange={handleInputChange}
                  className={formErrors.phone ? 'error' : ''}
                  placeholder="0912 345 6789"
                />
              </div>
            </div>
          </div>

          {/* Section 2: Family Background */}
          <div className="form-section">
            <div className="section-header">
              <span className="section-number">II.</span>
              <h3>FAMILY BACKGROUND</h3>
            </div>
            
            <div className="form-grid">
              <div className="input-group">
                <label>Father's Name <span className="required">*</span></label>
                <input
                  type="text"
                  name="father_name"
                  value={formData.father_name}
                  onChange={handleInputChange}
                  className={formErrors.father_name ? 'error' : ''}
                  placeholder="Juan C. Dela Cruz"
                />
              </div>

              <div className="input-group">
                <label>Father's Occupation</label>
                <input
                  type="text"
                  name="father_occupation"
                  value={formData.father_occupation}
                  onChange={handleInputChange}
                  placeholder="Engineer"
                />
              </div>

              <div className="input-group">
                <label>Mother's Name <span className="required">*</span></label>
                <input
                  type="text"
                  name="mother_name"
                  value={formData.mother_name}
                  onChange={handleInputChange}
                  className={formErrors.mother_name ? 'error' : ''}
                  placeholder="Maria R. Dela Cruz"
                />
              </div>

              <div className="input-group">
                <label>Mother's Occupation</label>
                <input
                  type="text"
                  name="mother_occupation"
                  value={formData.mother_occupation}
                  onChange={handleInputChange}
                  placeholder="Teacher"
                />
              </div>

              <div className="input-group">
                <label>Guardian's Name (if different)</label>
                <input
                  type="text"
                  name="guardian_name"
                  value={formData.guardian_name}
                  onChange={handleInputChange}
                />
              </div>

              <div className="input-group">
                <label>Guardian's Contact Number</label>
                <input
                  type="tel"
                  name="guardian_contact"
                  value={formData.guardian_contact}
                  onChange={handleInputChange}
                />
              </div>
            </div>
          </div>

          {/* Section 3: Educational Background */}
          <div className="form-section">
            <div className="section-header">
              <span className="section-number">III.</span>
              <h3>EDUCATIONAL BACKGROUND</h3>
            </div>
            
            <div className="education-table">
              <div className="table-header">
                <div>Level</div>
                <div>Name of School</div>
                <div>Year Graduated</div>
              </div>
              
              <div className="table-row">
                <div className="table-label">Elementary <span className="required">*</span></div>
                <div className="table-input">
                  <input
                    type="text"
                    name="elementary_school"
                    value={formData.elementary_school}
                    onChange={handleInputChange}
                    className={formErrors.elementary_school ? 'error' : ''}
                  />
                </div>
                <div className="table-input">
                  <input
                    type="text"
                    name="elementary_year"
                    value={formData.elementary_year}
                    onChange={handleInputChange}
                    placeholder="2016"
                  />
                </div>
              </div>

              <div className="table-row">
                <div className="table-label">Junior High School <span className="required">*</span></div>
                <div className="table-input">
                  <input
                    type="text"
                    name="junior_high"
                    value={formData.junior_high}
                    onChange={handleInputChange}
                    className={formErrors.junior_high ? 'error' : ''}
                  />
                </div>
                <div className="table-input">
                  <input
                    type="text"
                    name="junior_high_year"
                    value={formData.junior_high_year}
                    onChange={handleInputChange}
                    placeholder="2020"
                  />
                </div>
              </div>

              <div className="table-row">
                <div className="table-label">Senior High School <span className="required">*</span></div>
                <div className="table-input">
                  <input
                    type="text"
                    name="senior_high"
                    value={formData.senior_high}
                    onChange={handleInputChange}
                    className={formErrors.senior_high ? 'error' : ''}
                  />
                </div>
                <div className="table-input">
                  <input
                    type="text"
                    name="senior_high_year"
                    value={formData.senior_high_year}
                    onChange={handleInputChange}
                    placeholder="2022"
                  />
                </div>
              </div>
            </div>

            <div className="input-group full-width">
              <label>Last School Attended (for Transferees)</label>
              <input
                type="text"
                name="last_school_attended"
                value={formData.last_school_attended}
                onChange={handleInputChange}
                placeholder="Name of previous college/university"
              />
            </div>
          </div>

          {/* Section 4: Course Preference */}
          <div className="form-section">
            <div className="section-header">
              <span className="section-number">IV.</span>
              <h3>COURSE PREFERENCE</h3>
            </div>
            
            <div className="course-preferences">
              <div className="input-group">
                <label>First Choice <span className="required">*</span></label>
                <select
                  name="course_choice_1"
                  value={formData.course_choice_1}
                  onChange={handleInputChange}
                  className={formErrors.course_choice_1 ? 'error' : ''}
                >
                  <option value="">Select Course</option>
                  {courses.map(course => (
                    <option key={course} value={course}>{course}</option>
                  ))}
                </select>
              </div>

              <div className="input-group">
                <label>Second Choice</label>
                <select
                  name="course_choice_2"
                  value={formData.course_choice_2}
                  onChange={handleInputChange}
                >
                  <option value="">Select Course</option>
                  {courses.map(course => (
                    <option key={course} value={course}>{course}</option>
                  ))}
                </select>
              </div>

              <div className="input-group">
                <label>Third Choice</label>
                <select
                  name="course_choice_3"
                  value={formData.course_choice_3}
                  onChange={handleInputChange}
                >
                  <option value="">Select Course</option>
                  {courses.map(course => (
                    <option key={course} value={course}>{course}</option>
                  ))}
                </select>
              </div>
            </div>
          </div>

          {/* Section 5: Documents */}
          <div className="form-section">
            <div className="section-header">
              <span className="section-number">V.</span>
              <h3>REQUIRED DOCUMENTS</h3>
            </div>
            
            <div className="documents-list">
              <FileUpload 
                label="PSA Birth Certificate"
                fileType="birth_certificate"
                accept=".pdf,.jpg,.jpeg,.png"
                onFileUpload={handleFileUpload}
                currentFile={formData.birth_certificate}
              />
              
              <FileUpload 
                label="Form 137 (Original)"
                fileType="form_137"
                accept=".pdf,.jpg,.jpeg,.png"
                onFileUpload={handleFileUpload}
                currentFile={formData.form_137}
              />
              
              <FileUpload 
                label="Form 138 (Report Card)"
                fileType="form_138"
                accept=".pdf,.jpg,.jpeg,.png"
                onFileUpload={handleFileUpload}
                currentFile={formData.form_138}
              />
              
              <FileUpload 
                label="Certificate of Good Moral"
                fileType="good_moral"
                accept=".pdf,.jpg,.jpeg,.png"
                onFileUpload={handleFileUpload}
                currentFile={formData.good_moral}
              />
              
              <FileUpload 
                label="2x2 ID Photos (Recent)"
                fileType="id_photos"
                accept="image/*"
                onFileUpload={handleFileUpload}
                currentFile={formData.id_photos}
              />
            </div>
          </div>

          {/* Declaration */}
          <div className="declaration-section">
            <div className="declaration-content">
              <p>
                <strong>DECLARATION:</strong> I hereby certify that the information provided in this application form is true and correct to the best of my knowledge. 
                I understand that any misrepresentation may result in the cancellation of my admission.
              </p>
            </div>
            
            <div className="signature-section">
              <div className="input-group">
                <label>Applicant's Signature</label>
                <input type="text" placeholder="Type your full name as signature" />
              </div>
              <div className="input-group">
                <label>Date</label>
                <input type="text" value={new Date().toLocaleDateString()} readOnly />
              </div>
            </div>
          </div>

          {/* Submit Button */}
          <div className="form-actions">
            <button type="submit" disabled={loading} className="submit-btn">
              {loading ? 'SUBMITTING APPLICATION...' : 'SUBMIT APPLICATION'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AdmissionForm;
